import React,{Component} from 'react';
import {
  Switch,
  Route
} from "react-router-dom";
import {useSelector,useDispatch} from 'react-redux';
import {SignOut} from './redux/actions';
import Login from './login';
import Register from './register';
import Accounts from './Accounts';
import Profile from './Profile';
import Nav from './Nav';
import Password from './Password';
import Remove from './Remove';
import './App.css';
import 'tachyons';

const App=()=> {
    const logIn=useSelector(state=>state.SignIn);
    const user=useSelector(state=>state.Fill);
    const dispatch=useDispatch();
      return (
      <div className="App">
        <nav class="ph3 ph5-ns pv4 w-100">
  <div class="nowrap overflow-x-auto">
   <input type="button" onClick={()=>console.log(user)} value="See user"/>
        {logIn?
        <div>
          <Nav link="users" name="Active Users"/>
          <Nav link="profile" name="Profile"/>
          <a className="link dim black dib mr3 pa2" 
          title='signout'
          onClick={()=>{dispatch(SignOut())}}
          >Sign Out</a>
        </div>
        :<div>
           <Nav link="signin" name="Sign In"/>
        <Nav link="signup" name="Sign Up"/>
          </div>
        }

        </div>
          </nav>
        <Switch>

          {logIn?<div>
          <Route path="/users">
            <Accounts/>
          </Route>
          <Route path="/profile">
            <Profile/>
            <br/>
            <Password/>
            <br/>
            <Remove/>
            <br/>
          </Route>
          </div>
          :
          <div>
          <Route  exact path="/">
                <Login/>
              </Route>
              <Route path="/signup">
                <Register/>
              </Route>
            </div>}
        </Switch>

      </div>
    );

}

export default App;
